export const TitleBar = (props) => {
    return (
        <>
            <header>
                <div class="heading">HOME</div>
                <div class="logout">
                    <button><i
                        class="fa-solid fa-arrow-right-from-bracket"
                        // onClick={() => PageTransition("./Login")}
                    ></i></button>
                </div>
            </header>
        </>

    )
}
